window.bookSummaryJSON = "<p><b>If you've been waiting to jump into </b><b><i>The Magitech Chronicles</i></b><b> there has never been a better time. Thirteen books for one low price!</b><br> <br> The gods are dead, but they are not gone. Their bodies litter the cosmos, magical fuel for vast interstellar empires, giving birth to mages, and more importantly, to magitech.<br> <br> Yet all things are cyclic. The godswar arises and ceases, and is upon us once more.<br> <br> Join an unlikely band of heroes as they oppose the ancient darkness threatening to escape the umbral depths, and devour all realities.&nbsp;</p> <p><b><i>Want to make your own characters? The Magitech Chronicles RPG system allows you to be part of the action long after you finish the books. Learn more at magitechchronicles.com or by checking us out on World Anvil.</i></b></p>"; 
